import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="bg-blue-500 text-white p-4">
        <h1 className="">Hello, Tailwind CSS with React!</h1>
      </header>
      <main className="p-4">
        <p className="text-gray-700">
          This is a sample application to demonstrate how to use Tailwind CSS with React.
        </p>
      </main>
      
    </div>
  );
}

export default App;
